const EventsPage = () => {
  const fetchData = fetch("https://pokeapi.co/api/v2/pokemon/bulbasaur")
    .then((response) => {
      if (!response.ok) {
        throw new Error("not founddddd");
      }
      return response.json();
    })
    .then((data) => console.log(data.name))
    .catch((error) => console.log(error));
  return <h1>hello</h1>;
  {
    fetchData;
  }
};

export default EventsPage;
